

CREATE TABLE IF NOT EXISTS `pla_databoard` (
  `no` int(11) NOT NULL AUTO_INCREMENT,
  `kantor_id` varchar(40) NOT NULL,
  `insert_org` varchar(100) NOT NULL,
  `correct_org` varchar(100) NOT NULL,
  `regdate` varchar(20) NOT NULL,
  `company` varchar(100) NOT NULL,
  `vessel` varchar(100) NOT NULL,
  `by1` varchar(50) NOT NULL,
  `blno` varchar(50) NOT NULL,
  `doc` text NOT NULL,
  `odr` text NOT NULL,
  `supplier` text NOT NULL,
  `qty` varchar(10) NOT NULL,
  `unit` varchar(10) NOT NULL,
  `size` text NOT NULL,
  `weight` varchar(10) NOT NULL,
  `in1` varchar(20) NOT NULL,
  `whouse` varchar(100) NOT NULL,
  `port` varchar(100) NOT NULL,
  `out1` varchar(20) NOT NULL,
  `remark` text NOT NULL,
  `img` varchar(1000) NOT NULL,
  `img1` varchar(1000) NOT NULL,
  `img2` varchar(1000) NOT NULL,
  `pdf` varchar(1000) NOT NULL,
  `division` varchar(10) NOT NULL,
  `flg` varchar(10) NOT NULL,
  `jobno` varchar(50) NOT NULL,
  `work` varchar(10) NOT NULL,
  `work_regdate` varchar(20) NOT NULL,
  PRIMARY KEY (`no`)
) ENGINE=MyISAM  DEFAULT CHARSET=utf8 AUTO_INCREMENT=78442 ;




